import React from "react";
import Row from 'common/components/Row';
import Col from 'common/components/Col';
import FormControl from "common/components/FormControl";
import TextInput from "common/components/TextInput";
import ErrorMessage from "common/components/ErrorMessage";

const UserInfo = ({formProps: { register, errors }}) => {
    return (
        <Row>
            <Col>
                <FormControl>
                    <label>First name</label>
                    <TextInput name="firstName" ref={register} placeholder="First name"/>
                    {errors.firstName && <ErrorMessage>{errors.firstName.message}</ErrorMessage>}
                </FormControl>
                <FormControl>
                    <label>Last name</label>
                    <TextInput name="lastName" ref={register}/>
                    {errors.lastName && <ErrorMessage>{errors.lastName.message}</ErrorMessage>}
                </FormControl>
                <FormControl>
                    <label>Nickname</label>
                    <TextInput name="nickname" ref={register}/>
                    {errors.nickname && <ErrorMessage>{errors.nickname.message}</ErrorMessage>}
                </FormControl>
                <FormControl>
                    <label>Email address</label>
                    <TextInput name="email" ref={register}/>
                    {errors.email && <ErrorMessage>{errors.email.message}</ErrorMessage>}
                </FormControl>
            </Col>
            <Col>
                <FormControl>
                    <label>Phone number</label>
                    <TextInput name="phoneNumber" ref={register}/>
                    {errors.phoneNumber && <ErrorMessage>{errors.phoneNumber.message}</ErrorMessage>}
                </FormControl>
                <FormControl>
                    <label>Congenital disease</label>
                    <TextInput name="conDisease" ref={register}/>
                    {errors.conDisease && <ErrorMessage>{errors.conDisease.message}</ErrorMessage>}
                </FormControl>
                <FormControl>
                    <label>Allergic food</label>
                    <TextInput name="allergicFood" ref={register}/>
                    {errors.allergicFood && <ErrorMessage>{errors.allergicFood.message}</ErrorMessage>}
                </FormControl>
            </Col>
        </Row>
    )
}

export default UserInfo;
